
<!-- wap to print all elements of an array not equels to given no. -->



<script>
    var d= [10,20,30,40,50,60,70,80,69]
    
    var t = parseInt(prompt("Enter a num : "))
    
    d.forEach((data,index)=>{
        if(data!=t){
            document.write(data+" ")
        }   
    });
    </script>
